import React from 'react';
import Card from './Card';
import Data from './Data';

function Blog() {
    return (
        <>
    const Data.map((val,index){
            <Card 
                title={val.title}
                imgsrc={val.imgsrc}
                para={val.para}
            />
        
    })
        </>
    );
}
export default Blog
